import React, {useEffect, useState} from 'react';
import axios from "axios";
import {useNavigate} from "react-router-dom";

const AddTableForm = ({onClose}) => {
  const navigate = useNavigate();
  const [file, setFile] = useState([]);
  const [selected_file, setSelected_file] = useState(null);
  const [formData, setFormData] = useState({
    name: '',
    description:  '',
    file_id: '',
    file_name: '',
    columns: '',
    model_type_id: '',
    hyper_parameters: ''
  });

  useEffect(() => {
    // Fetch tasks from Flask backend using Axios
    axios.get('http://127.0.0.1:5000/viewModelType')
      .then(response => {
        setFile(response.data);
        console.log(response.data);
      })
      .catch(error => {
        console.error('Error fetching pulling:', error);
      });
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:5000/addTableConfig', formData, {
        headers: {
            'Content-Type': 'application/json',
        }
})

      if (response.status === 200) {
        alert('Created Successfully');
        onClose();
        navigate('/table');
      }
    } catch (error) {
      alert('Created failed');
      onClose();
      navigate('/table');
    }
  };

  return (
      <form onSubmit={handleSubmit}>
          <label>
              Name:
              <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
              />
          </label>

          <label>
              Description:
              <textarea
                  name="description"
                  value={formData.description}
                  onChange={handleChange}
              />
          </label>

          <div>
              <label htmlFor="file">File</label>
              <select
                  id="file"
                  value={selected_file}
                  onChange={(e) => setSelected_file(e.target.value)}
              >
                  <option value="" disabled>Select File</option>
                  {file.map((f) => (
                      <option key={f.id} value={f.id}>
                          {f.name}
                      </option>
                  ))}
              </select>

          </div>

          <label>
              Columns selected eg.(a, b, c):
              <input
                  type="text"
                  name="columns"
                  value={formData.columns}
                  onChange={handleChange}
              />
          </label>

          <div>
              <label htmlFor="type">Model Type</label>
              <select
                  id="type"
                  value={selected_type}
                  onChange={(e) => setSelected_type(e.target.value)}
              >
                  <option value="" disabled>Select Model Type</option>
                  {MType.map((type) => (
                      <option key={type.id} value={type.id}>
                          {type.type_name}
                      </option>
                  ))}
              </select>
              <p>Selected Model Type ID: {selected_type}</p>
          </div>

          <label>
              Hyper parameters:
              <input
                  type="text"
                  name="hyper_parameters"
                  value={formData.hyper_parameters}
                  onChange={handleChange}
              />
          </label>

          {/* Add more input fields for other properties as necessary */}

          <button type="submit">Submit</button>
          <button type="button" onClick={onClose}>Cancel</button>
      </form>
  );
};

export default AddTableForm;
